class InsaneMap(Map):
    @classmethod
    def init(cls, game: Game, players):
        template = MAP.replace(' ', '')
        rows = template.split('\n')

        width = len(rows)
        height = len(rows[0])
        game.size = (width, height)

        for i in range(width):
            for j in range(height):
                if rows[i][j] == '&':
                    game.objects[(i, j)] = water()
                if rows[i][j] == '.':
                    game.objects[(i, j)] = dirt()
                if rows[i][j] == '@':
                    game.objects[(i, j)] = wall()
                if rows[i][j] == '1':
                    game.objects[(i, j)] = SpeedUpgrade()
                if rows[i][j] == '2':
                    game.objects[(i, j)] = YellowDoor()
                if rows[i][j] == '3':
                    game.objects[(i, j)] = PinkKey()
                if rows[i][j] == '4':
                    game.objects[(i, j)] = SpawnPoint()
                if rows[i][j] == '5':
                    game.objects[(i, j)] = WallFight()
                if rows[i][j] == '6':
                    game.objects[(i, j)] = PinkDoor()
                if rows[i][j] == '7':
                    game.objects[(i, j)] = NuclearBomb()
                if rows[i][j] == '8':
                    game.objects[(i, j)] = PiwPaw()
                if rows[i][j] == '9':
                    game.objects[(i, j)] = BlueDoor()
                if rows[i][j] == '1.':
                    game.objects[(i, j)] = YellowKey()
                if rows[i][j] == '11':
                    game.objects[(i, j)] = BlueKey()
                if rows[i][j] == '12':
                    game.objects[(i, j)] = HealthKit()


        for player in players:
            while True:
                x, y = random.choice[(10, 31)(22, 104)(40, 74)(79, 7)(80, 114)]
                if (x, y) in game.objects or (x, y) in game.items:
                    continue

                game.players[(x, y)] = Player(player)
                break